import "./app.scss";

import App, { Container } from "next/app";
import React from "react";

export default class NextFirst extends App {
	render() {
		const { Component, pageProps } = this.props;
		return (
			<Container>
				<Component {...pageProps} />
			</Container>
		);
	}
}
